import * as React from 'react';
import { AppBar, Toolbar, Typography, Menu, MenuItem } from '@mui/material';
import {makeStyles} from '@mui/styles';
import PopupState, { bindTrigger, bindMenu } from 'material-ui-popup-state';

const useStyles = makeStyles((theme) => ({
  menuItem: {
    padding: theme.spacing(1, 2),
    '&:hover': {
      backgroundColor: theme.palette.primary.dark,
    },
  },
}));

const DashboardNavBar = () => {
  const classes = useStyles();

  return (
    <AppBar position="static" color="primary">
      <Toolbar>
        <PopupState variant="popover" popupId="clientes-popup-menu">
          {(popupState) => (
            <React.Fragment>
              <Typography
                variant="h6"
                color="inherit"
                noWrap
                {...bindTrigger(popupState)}
                className={classes.menuItem}
              >
                Clientes
              </Typography>
              <Menu {...bindMenu(popupState)}>
                <MenuItem onClick={popupState.close} className={classes.menuItem}>
                  Agregar Cliente
                </MenuItem>
              </Menu>
            </React.Fragment>
          )}
        </PopupState>
        <PopupState variant="popover" popupId="servicios-popup-menu">
          {(popupState) => (
            <React.Fragment>
              <Typography
                variant="h6"
                color="inherit"
                noWrap
                {...bindTrigger(popupState)}
                className={classes.menuItem}
              >
                Servicios
              </Typography>
              <Menu {...bindMenu(popupState)}>
                <MenuItem onClick={popupState.close} className={classes.menuItem}>
                  Agregar Servicio
                </MenuItem>
              </Menu>
            </React.Fragment>
          )}
        </PopupState>
        <PopupState variant="popover" popupId="profesionales-popup-menu">
          {(popupState) => (
            <React.Fragment>
              <Typography
                variant="h6"
                color="inherit"
                noWrap
                {...bindTrigger(popupState)}
                className={classes.menuItem}
              >
                Profesionales
              </Typography>
              <Menu {...bindMenu(popupState)}>
                <MenuItem onClick={popupState.close} className={classes.menuItem}>
                  Agregar Profesional
                </MenuItem>
              </Menu>
            </React.Fragment>
          )}
        </PopupState>
      </Toolbar>
    </AppBar>
  );
}

export default DashboardNavBar;
